function slice_generator(generator: Generator<bigint>, start: bigint, end: bigint): bigint[] {
  let i = 0
  const r: bigint[] = []
  while (i++<start) {
    generator.next()
  }
  while (i++<=end) {
    r.push(generator.next().value)
  }
  return r
}

